import React from 'react'
import ReactDOM from 'react-dom'

const jsxElement = <h1>This is jsx element</h1>
const title = <h1>Getting Started with React</h1>

const headerStyles = {
  backgroundColor: '#61DBFB',
  fontFamily: 'Helvetica Neue',
  padding: 25,
  lineHeight: 1.5,
}

const header = (
  <header style={headerStyles}>
    <h1>Welcome to the 30 days of react</h1>
    <h2>Mewww</h2>
  </header>
)

const main  = (
  <main style={{
    backgroundColor: '#F3F0F5',
  }}>
    <h1>This is main</h1>
  </main>
)

const footer = (
  <footer style={ {
    backgroundColor: '#61DBFB',
  }}>
      <p>Copyright@2023</p>
  </footer>
)

const app = (
  <>
    {jsxElement}
    {title}
    {header}
    {main}
    {footer}
  </>
)
const rootElement = document.getElementById('root')

ReactDOM.render(app, rootElement)
